import React, { Component } from 'react';
import Screen1 from './Screen1';
import Screen2 from './Screen2';

class App extends Component{
	state = {
		'auth':true,
	}
	render(){
		return(
			<div className = 'container'>
				{this.state.login?<Screen1/>:<Screen2/>}
			</div>
		);
	}
}

export default App;
